import React from 'react';
import logo from './logo.svg';
import './App.css';


class App extends React.Component {

  constructor(props){
    super(props);
    this.state = {
      value: 'Texto 1',
      value2: 'Texto 2'
    }
  }

render() {

  return (
    <div className="App">
      <header className="App-header">
        <textarea value={this.state.value}/>
        <textarea value={this.state.value2}/>
      </header>
    </div>
  );
}
}

export default App;
